"use strict";
/** Primitive data types:
 *  1.String
 *  2.Number
 *  3.Boolean
 *  4.Undefined
 *  5.Null
 */
// string
let fullName = "Sabbir Hossain";
// number
let age = 25;
// boolean
let isDeveloper = true;
// undefined
let u = undefined;
// null
let n = null;
/* Dynamic data types or any (Tips: Avoid) */
let pending;
pending = 2809;
pending = "Sabbir";
pending = true;
/** Non-Primitive data types:
 *  1.Array,
 *  2.Object
 */
let friendZone = ["Sabbir", "Komol", "Salkin", "Mizan", "Maruf", "Sajia", "Shefa", "Zafrin"];
let studentId = [2809, 2861, 2891, 2788, 2830, 2903, 2787, 2832];
// tuple -> array -> order maintain -> type of values
let coordinates = [2, 6];
let ageName = [25, "Sabbir"];
ageName[0] = 26;
